www.rki.de/SharedDocs/FAQ/COVID-Impfen/FAQ_Liste_Impfstofftypen.html ";export const last_info9="Die Studie wurde im Rahmen des EU-finanzierten Projektes „TWON – Twin of an online social network“ durchgeführt, das die potenziell schädlichen Auswirkungen sozialer Online-Netzwerke (OSN) auf demokratische Debatten untersuchen soll. Durch die Schaffung eines digitalen Zwillings eines OSN und dessen Befüllung mit generativer künstlicher Intelligenz führt das TWON-Team einen einzigartigen Ansatz zur Untersuchung demokratischer Online-Debatten an, der unabhängig vom guten Willen von Unternehmen wie Twitter, Meta oder TikTok ist. Kooperierende Partnerinstitutionen sind die Universität Amsterdam, Universität Trier, das Jozef Stefan Institut, das Karlsruher Institut für Technologie, das Robert Koch-Institut, die Universität Belgrad, die Slovenian Press Agency, das Forschungszentrum Informatik und der DialoguePersepctives e.V.. ";export const last_info10="Mehr Informationen zu TWON finden Sie hier: ";export const last_info10_link=" https://www.twon-project.eu/";export const post_q42="Na kraju, da li postoji još nešto što biste želiti da nam kažete o studiji?";export const post_q8_info=[/*#__PURE__*/_jsx("strong",{children:"Molimo Vas da kliknete ovde kako biste zavr\u0161ili upitnik i primili svoju nadoknadu. "})];export const followers="Follower";export const followings="Following";export const disclaim="HAFTUNGSAUSSCHLUSS: Diese Anwendung wurde im Rahmen eines Forschungsprojekts entwickelt und dient dazu, Daten über das Verhalten und die Interaktionen der Nutzer zu sammeln, einschließlich der Reaktionen auf Posts und Muster. Es wird empfohlen, diese Anwendung nicht zu verwenden, es sei denn, Sie möchten freiwillig Daten zu dem Projekt beitragen. Sollten Sie die Anwendung zunächst nutzen, aber später beschließen, Ihre Daten zu löschen, kontaktieren Sie uns bitte unter alenka.gucek@ijs.si. Bitte beachten Sie, dass diese Anwendung nicht für den öffentlichen Gebrauch bestimmt ist und nicht als allgemeiner Service dient. Übersetzt mit DeepL.com (kostenlose Version)";export const email="E-Mail";export const Password="Passwort";export const Failed_Update_profile="Dein Profil konnte nicht hochgeladen werden";export const Save_profile="Profil speichern";export const Select_from_Gallery="Aus der Galerie wählen";export const Profile_Saved="Profil gespeichert";export const Progress_Day_1="Fortschritt Tag 1";export const Progress_Day_2="Fortschritt Tag 2";export const Progress_Day_3="Fortschritt Tag 3";export const Progress_Day_4="Fortschritt Tag 4";export const Progress_Day_5="Fortschritt Tag 5";export const Submit_Post_Survey="Pošaljite odgovore";export const Signup="Anmelden";export const Type_a_message_here="Nachricht schreiben…";export const Send="Schicken";export const Open_a_conversation="Öffne eine Konversation, um einen Chat zu beginnen.";export const Conversation="Konversation";export const Pull_down_to_refresh="Zum Aktualisieren nach unten ziehen";export const Release_to_refresh="Zum Aktualisieren loslassen";export const Personal_Information="Persönliche Informationen";export const Not_available="Nicht verfügbar";export const Profile_details="Profildetails";export const Log_Out="Ausloggen";export const Time_Spent="Verbrachte Zeit ";export const click_to_see_more="Hier klicken, um mehr zu sehen";export const comments="Komentara";export const Write_something="Piši nešto...";export const Search_input="Input suchen";export const What_in_your_mind="Woran denkst du gerade ";export const Location="Standort";export const Feelings="Gefühle";export const Searche="Suchen";export const A_user_with="Ein Benutzer mit diesem Namen/E-Mail existiert bereits. Verwende einen anderen Namen/eine andere E-Mail-Adresse. Oder die verwendete Url für die Registrierung ist falsch.";

